import { useState } from "react"


function CoolCounter(){
    let [myCount, setMyCount] = useState(5)


    return (
        <div>
           <h1>{myCount}</h1>
           <button onClick={()=>setMyCount(myCount+1)}>Decrease</button>
           <button onClick={()=> setMyCount(myCount-1)}>Increase</button>
        </div>
    )
}

export default CoolCounter
